import React from "react";
import { Container, Stack } from "react-bootstrap";

function Strategy() {
  return (
    <Container fluid>
      <div style={{ textAlign: "center" }}>
        <h1 style={{ fontFamily: "primary-font", fontSize: 55 }}>
          Our strategy
        </h1>
      </div>
    </Container>
  );
}

export default Strategy;
